import React, { useState, useEffect, useContext } from 'react';
import { NavLink, useHistory } from "react-router-dom";
import Swal from 'sweetalert2';
import { UserContext } from "../App";

const BookingRequest = () => {
    const [bookingData, setBookingData] = useState({ brand: "", model: "", year: "", name: "", email: "", phone: "" });
    const { state } = useContext(UserContext);
    const history = useHistory();

    useEffect(() => {
        if (!state) {
            Swal.fire({
                title: 'Please sign in to make a booking!',
                icon: 'warning',
                showCancelButton: true,
                confirmButtonText: 'OK'
            }).then((result) => {
                if (result.isConfirmed) {
                    history.push('/signin');
                } else {
                    history.push('/');
                }
            });
        } else {
            // If the user is logged in, fill the email, phone, and name automatically
            setBookingData({ ...bookingData, email: state.email, phone: state.phone, name: state.name });
        }
    }, [state, history]);

    const handleInputs = (e) => {
        const name = e.target.name;
        const value = e.target.value;

        setBookingData({ ...bookingData, [name]: value });
    }

    const makeBooking = async (e) => {
        e.preventDefault();

        const { brand, model, year, name, email, phone } = bookingData;

        if (!brand || !model || !year || !name || !email || !phone) {
            Swal.fire({
                icon: 'error',
                title: 'Invalid Booking',
                text: 'Please fill in all the fields',
                showConfirmButton: true,
            });
            return;
        }

        // Send the booking request only if the user is logged in
        if (state) {
            const res = await fetch('/booking', {
                method: 'POST',
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({
                    brand, model, year, name, email, phone
                })
            });

            const data = await res.json();

            if (!data) {
                console.log("booking not made");
            } else {
                Swal.fire(
                    {
                        icon: 'success',
                        title: 'Your booking has been made',
                        showConfirmButton: false,
                        timer: 1500
                    }
                )
                setBookingData({ brand: "", model: "", year: "", name: "", email: "", phone: "" });
            }
        }
    }

    return (
        <>
            {state && (
                <div>
                    <div className="contactheader">
                        <header className="header">
                            <div id="menu-btn" className="fas fa-bars"></div>
                            <NavLink className="logo" to="/">
                                Car<span>Rent</span>
                            </NavLink>
                            <nav className="navbar">
                                <NavLink to="/">Home</NavLink>
                                <NavLink to="/rentcar">Rent A Car</NavLink>
                                <NavLink to="/about">About</NavLink>
                                <a href="/#services">Testimonial</a>
                                <a href="/contact">Contact</a>
                            </nav>
                            <div id="login-btn">
                                <button><NavLink className="btn" to="/signout">logout</NavLink></button>
                            </div>
                        </header>
                    </div>
                    <section className="booking" id="booking">
                        <h1 className="heading">
                            <span>make a</span> booking
                        </h1>
                        <div className="row">
                            <form method="POST">
                                <h3>Choose your car and make a booking</h3>
                                <input type="text" name="brand" value={bookingData.brand} onChange={handleInputs} placeholder="Car Brand" className="box" />
                                <input type="text" name="model" value={bookingData.model} onChange={handleInputs} placeholder="Car Model" className="box" />
                                <input type="text" name="year" value={bookingData.year} onChange={handleInputs} placeholder="Car Year" className="box" />
                                <input type="text" name="name" value={bookingData.name} onChange={handleInputs} placeholder="Your Name" className="box" />
                                <input type="email" name="email" value={bookingData.email} onChange={handleInputs} placeholder="Your Email" className="box" />
                                <input type="tel" name="phone" value={bookingData.phone} onChange={handleInputs} placeholder="Your Phone" className="box" />
                                <input type="submit" value="Make Booking" onClick={makeBooking} className="btn" />
                            </form>
                        </div>
                    </section>
                    <section className="footer" id="footer">
                        <div className="box-container">
                            <div className="box">
                                <h3>our branch</h3>
                                <a href="#"> <i className="fas fa-map-marker-alt"></i> Algeria, Blida, Ouled Yaich </a>
                            </div>
                            <div className="box">
                                <h3>quick links</h3>
                                <a href="#"> <i className="fas fa-arrow-right"></i> home </a>
                                <a href="rentcar"> <i className="fas fa-arrow-right"></i> vehicles </a>
                                <a href="#services"> <i className="fas fa-arrow-right"></i> reviews </a>
                                <a href="#contact"> <i className="fas fa-arrow-right"></i> contact </a>
                            </div>
                            <div className="box">
                                <h3>contact info</h3>
                                <a href="#"> <i className="fas fa-phone"></i> +123-456-7890 </a>
                                <a href="#"> <i className="fas fa-phone"></i> +111-222-3333 </a>
                                <a href="#"> <i className="fas fa-envelope"></i> carrent@gmail.com </a>
                            </div>
                            <div className="box">
                                <h3>contact info</h3>
                                <a href="#"> <i className="fab fa-facebook-f"></i> facebook : carrentdz </a>
                                <a href="#"> <i className="fab fa-whatsapp"></i> whatsapp : +123-456-789</a>
                                <a href="#"> <i className="fab fa-instagram"></i> instagram : carrentdz</a>
                            </div>
                        </div>
                        <div className="credit"> All rights reserved </div>
                    </section>
                </div>
            )}
        </>
    );
}

export default BookingRequest;
